import logo from './logo.svg';
import './App.css';
import Home from'./components/home/home'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';



function App() {
  return (
    <Router>
    <div className="App">
    <Routes>
      <Route exact path="/" component={Home} />
      </Routes>
    </div>
    </Router>

  );
}

export default App;
